import React from 'react';

export default function RecipeLayout() {
  return (
    <div className="min-h-screen bg-gray-100 font-sans text-gray-800">
      {/* Header */}
      <header className="bg-[#14523F] h-[100px] flex items-center px-6 shadow">
        <img
          src="/Toque_Logo_White.png"
          alt="Toque Logo"
          className="h-[75px] w-[75px] mr-4"
        />
        <h1 className="text-white text-3xl font-bold">Recipe Manager</h1>
      </header>

      {/* Subheader */}
      <div className="bg-[#317A64] h-[60px] flex items-center px-6 shadow">
        <span className="text-white font-medium">Dashboard / Recipes</span>
      </div>

      {/* Content Container */}
      <main className="max-w-6xl mx-auto p-6">
        {/* Action Buttons */}
        <div className="flex justify-end space-x-2 mb-6">
          <button className="bg-green-700 text-white px-3 py-2 rounded hover:bg-green-800">New</button>
          <button className="bg-blue-600 text-white px-3 py-2 rounded hover:bg-blue-700">Duplicate</button>
          <button className="bg-red-600 text-white px-3 py-2 rounded hover:bg-red-700">Delete</button>
          <button className="bg-gray-600 text-white px-3 py-2 rounded hover:bg-gray-700">Print</button>
          <button className="bg-gray-600 text-white px-3 py-2 rounded hover:bg-gray-700">Back</button>
          <button className="bg-yellow-500 text-white px-3 py-2 rounded hover:bg-yellow-600">Backup</button>
        </div>

        {/* Placeholder for recipe body */}
        <div className="bg-white border rounded shadow p-6">
          <p className="text-gray-500 italic">Recipe form and ingredient tables coming next...</p>
        </div>
      </main>
    </div>
  );
}
